import React, { useState } from 'react';
import axios from 'axios'; 
import Logo from './img/xzerologo.png'; 

function App() {
  const [webhook , setWebhook] = useState(''); 
  const [msg , setMsg] = useState('');

  function onChangeA(e) {
    setWebhook(e.target.value); 
  }
  function onChangeB(e) {
    setMsg(e.target.value); 
  }

  function onSubmit(e) {
    e.preventDefault(); 
    console.log({msg , webhook}); 
    fetch(webhook,{
      method:'POST',

    })
  }
  return (
    <div className="App">
        <div className="nav">
          <h1><a href="#webhooks">Webhook Sender</a></h1>
        </div>
        <div className="section">
          <form onSubmit={onSubmit}>
            <label htmlFor="webhook">Webhook URL</label>
            <input id="webhook" onChange={onChangeA} />
            <label htmlFor="message">Message</label>
            <input id="message" onChange={onChangeB} />
            <button class="btn btn-primary" type="submit">Send</button>
          </form>
        </div>
    </div>
  );
}

export default App;
